<p style="text-align: justify;">K.Sugimoto is a Â young talented Japanese soccer player who just turned 25 on November 12.sugimoto was born on 1992 at large port city Osaka on the Japanese island of <a href="https://www.britannica.com/place/Honshu" target="_blank" rel="noopener">Honshu</a>.The rising star plays attacking forward position for the national team Japan.</p>
<p style="text-align: justify;">Currently he is playing for Cerezo Osaka, a local club of OsakaÂ  with jersey number 9.</p>
<p style="text-align: justify;">1.87m tall Sugimoto is right footed and currently plays Japanese league. The talented Sugimoto has scored five times in a single game against Cambodia national team under 15 playing for Japanese national team under 15 in AFC under 16 championship qualifications. The game was held on Jakarta capital city of Indonesia the final score of the game was 7-0 in which combodian failed to score against Japan.</p>
<p style="text-align: justify;">In 2008 he was able to score twice against United Arab Emirates under 16 and one goal against Saudi Arabia both game was for the AFC under 16 championship qualifications</p>
<p style="text-align: justify;">In 2009 he scored once against Brazil under 17 the game was held on Teslim Balogun Stadium at Lagos.</p>
<p style="text-align: justify;">About his career on the club he was loaned to Tokyo Verdy after 4 years on Cerezo Osaka with 11 goals in 89 appearances in the league. He managed to score 5 league goals on 18 appearances from Tokyo Verdy. He wastransferred to Kawasaki Frontale on 2015 and managed to score 6 goals on 22 appearances from the club and transferred back to Cerezo Osaka currently he is playing for Cerezo Osaka with 20 goals and 54 appearances onwards 2016.</p>
<p style="text-align: justify;">Author:<a href="https://plus.google.com/+alexpunk41" target="_blank" rel="noopener">Suman</a></p>";s:10:"post_title";s:16:"Kenyu Sugimoto's";s:12:"post_excerpt";s:0:"";s:11:"post_status";s:7:"publish";s:14:"comment_status";s:4:"open";s:11:"ping_status";s:4:"open";s:13:"post_password";s:0:"";s:9:"post_name";s:14:"kenyu-sugimoto";s:7:"to_ping";s:0:"";s:6:"pinged";s:0:"";s:13:"post_modified";s:19:"2017-12-24 20:42:34";s:17:"post_modified_gmt";s:19:"2017-12-24 14:57:34";s:21:"post_content_filtered";s:0:"";s:11:"post_parent";s:1:"0";s:4:"guid";s:26:"http://wikiceleb.com/?p=41";s:10:"menu_order";s:1:"0";s:9:"post_type";s:4:"post";s:14:"post_mime_type";s:0:"";s:13:"comment_count";s:1:"0";}i:1;O:8:"stdClass":23:{s:2:"ID";s:3:"114";s:11:"post_author";s:1:"1";s:9:"post_date";s:19:"2017-11-30 17:50:29";s:13:"post_date_gmt";s:19:"2017-11-30 17:50:29";s:12:"post_content";s:3492:"<p style="text-align: justify;"><strong>Born</strong>: 13<sup>th</sup> June 1986</p>
<p style="text-align: justify;"><strong>Age</strong>: 31</p>
<p style="text-align: justify;"><strong>Nationality</strong>: Japan</p>
<p style="text-align: justify;"><strong>Birth Place</strong>: Settsu, Osaka, Japan</p>
<p style="text-align: justify;"><strong>Position</strong>: Midfielder</p>
<p style="text-align: justify;"><a href="http://wikiceleb.com/keisuke-hondas-biography/" target="_blank" rel="noopener">Keisuke Honda</a> was raised in Osaka. He used to play in theÂ  junior youth club during his school days however he started his professional career after completion of high school. On January 2008 he was singed for the <a href="https://www.vvv-venlo.nl/" target="_blank" rel="noopener">VVV-Venlo</a> (Football Club from Netherlands). Honda experienced the relegation for the first time in his career with the club. He was able to score 16 goals with 36 league appearances which made his team to get back to the league in 2008-9 season at Eredivisie(Netherlandâ€™s football League). From Netherland he was transferred to the Russian Football Club<a href="https://en.pfc-cska.com/" target="_blank" rel="noopener"> CSKA Moscow</a>. Honda made his debut from<a href="https://en.pfc-cska.com/" target="_blank" rel="noopener"> CSKA Moscow</a> in UEFA Champions League where he played against <a href="http://sevillafc.es/en" target="_blank" rel="noopener">Sevilla</a> but unfortunately he wasn't able to score on that match however in second leg he scored the wining goal and qualified for the quaterfinals.Â  His debut goal for the Russian club was against <a href="http://fc-amkar.org/" target="_blank" rel="noopener">FC Amkar</a> which was also a winning goal on third minute of injury time.</p>
<p style="text-align: justify;">Honda was on a free transfer for <a href="https://www.acmilan.com/en" target="_blank" rel="noopener">Milan</a> on October 2013. Then he made his contract with Milan till 2017 with number 10 on his jersey. Honda has scored vital goal for Milan his free kick goal against Bologna qualified Milan to Europa League for the first time. He had a successful career at <a href="https://www.acmilan.com/en">Milan</a> and was transferred to <a href="http://tuzos.com.mx" target="_blank" rel="noopener">Mexican Football Club Pachuca</a> on August 2017.</p>
<p style="text-align: justify;">Honda has scored all together of 36 goals for his country Japan. He was awarded as man of the match against Cameroon in FIFA World Cup 2010. He has also scored against Denmark in the final group stage round in FIFA World cup 2010 with a free Kick at the distance of 30 Yard from the goal post. He was again awarded as the man of the match and qualified his country for the knockout Rounds in FIFA world cup 2010. Honda is the first Japanese player to score in two world cups games. In FIFA World cup 2014 he scored against Ivory Coast . He has also earned the title of top Japanese Scorer for FIFA world cups. Honda has very successful international career.</p>
<p style="text-align: justify;">The Country Japan has been qualified for the FIFA World Cup 2018 which is going to be held on Russia. Honda will be representing his team in FIFA World Cup 2018 if he prevents any kind of injuries in upcoming days.</p>
<p style="text-align: justify;">Author: <a href="https://plus.google.com/+alexpunk41" target="_blank" rel="noopener">Suman</a></p>
<p style="text-align: justify;"></p>";s:10:"post_title";s:25:"Keisuke Honda's Biography";s:12:"post_excerpt";s:0:"";s:11:"post_status";s:7:"publish";s:14:"comment_status";s:4:"open";s:11:"ping_status";s:4:"open";s:13:"post_password";s:0:"";s:9:"post_name";s:24:"keisuke-hondas-biography";s:7:"to_ping";s:0:"";s:6:"pinged";s:0:"";s:13:"post_modified";s:19:"2017-12-02 05:53:42";s:17:"post_modified_gmt";s:19:"2017-12-02 05:53:42";s:21:"post_content_filtered";s:0:"";s:11:"post_parent";s:1:"0";s:4:"guid";s:27:"http://wikiceleb.com/?p=114";s:10:"menu_order";s:1:"0";s:9:"post_type";s:4:"post";s:14:"post_mime_type";s:0:"";s:13:"comment_count";s:1:"0";}i:2;O:8:"stdClass":23:{s:2:"ID";s:3:"408";s:11:"post_author";s:1:"1";s:9:"post_date";s:19:"2017-12-19 23:28:38";s:13:"post_date_gmt";s:19:"2017-12-19 17:43:38";s:12:"post_content";s:4920:"&nbsp;
<p style="text-align: justify;">The Southeastern European country that has appeared 6 FIFA World Cups and made it into 2 semifinals is Portugal. The Portugal Association of football was formed back in 1914. The defendingÂ  Euro Cup Champions with FIFA ranking 3 are qualified for the<a href="http://wikiceleb.com/russia-host-fifa-world-cup-2018/"> Russia</a> FIFA World Cup 2018. The best achievement so far for Portugal in FIFA World Cup was in 1966 where they ranked third in the last round of competition. In 1986, 2002 and 2014 Portugal did not make into the knockout rounds of FIFA World Cup. In 2006 they managed to get the fourth position. The great star on football history Cristiano Ronaldo plays for Portugal and he is the all-time leading scorer for Portugal and best FIFA Menâ€™s player.</p>
<img class="aligncenter wp-image-409" src="http://wikiceleb.com/wp-content/uploads/2017/12/portugal-national-football-team-2016-4-300x191.jpg" alt="" width="635" height="404" />

<strong><u>World Cup Qualifier Europe</u></strong>
<p style="text-align: justify;">The World Cup qualifier in Europe selects 14 countries for the FIFA World Cup and for 2018 FIFA World cup Russia qualifies being a host country. 52 countries who are the members of FIFA from Europe go for the preliminary competition where those 52 countries are divided into 9 groups in which 7 groups contain 6 teams and rest of the two group contains only 5 teams. <a href="http://wikiceleb.com/england-road-russia-fifa-world-cup-2018/">England</a>, <a href="http://wikiceleb.com/france-road-russia-fifa-world-cup-2018/" target="_blank" rel="noopener">France</a>, <a href="http://wikiceleb.com/germany-road-russia-fifa-world-cup-2018/">Germany</a>, Italy, Netherlands and <a href="http://wikiceleb.com/spain-road-russia-fifa-world-cup-2018/" target="_blank" rel="noopener">Spain</a> are placed in a group containing 6 teams. Winners from each group qualify automatically and the eight best runners-up go for the playoffs from which 4 teams are selected. Thus, in this way, the Europe qualifier selects 14 nations for the FIFA World Cup.</p>
<p style="text-align: justify;">Portugal was the group leader in group B with 9 wins in a total of 10 games. They were defeated against <a href="http://wikiceleb.com/switzerland-road-russia-fifa-world-cup-2018/" target="_blank" rel="noopener">Switzerland</a> in the very first round of the Europe qualifier with the final score of 2-0.The performance of Portugal was very good during the rest of the rounds. Best performance of Portugal was against Faroe Islands with final score 0-6.</p>
<img class="aligncenter wp-image-410" src="http://wikiceleb.com/wp-content/uploads/2017/12/1476106200_cristiano-ronaldo-300x177.jpg" alt="" width="615" height="363" />

<strong><u>FIFA World Cup 2018 Group B</u></strong>

The final draw of FIFA World Cup 2018 has placed Portugal in Group B where Portugal has to play against <a href="http://wikiceleb.com/spain-road-russia-fifa-world-cup-2018/" target="_blank" rel="noopener">Spain</a> <a href="http://wikiceleb.com/iran-road-russia-fifa-world-cup-2018/" target="_blank" rel="noopener">Iran</a> and <a href="http://wikiceleb.com/morocco-road-russia-fifa-world-cup-2018/" target="_blank" rel="noopener">Morocco</a> and qualify for the Knockout stage into the round of Sixteenâ€™s.

