<a href="http://wikiceleb.com" target="_blank" rel="noopener">www.wikiceleb.com</a>";s:10:"post_title";s:43:"Portugal Road to Russia FIFA world cup 2018";s:12:"post_excerpt";s:0:"";s:11:"post_status";s:7:"publish";s:14:"comment_status";s:4:"open";s:11:"ping_status";s:4:"open";s:13:"post_password";s:0:"";s:9:"post_name";s:40:"portugal-road-russia-fifa-world-cup-2018";s:7:"to_ping";s:0:"";s:6:"pinged";s:0:"";s:13:"post_modified";s:19:"2018-01-22 23:59:00";s:17:"post_modified_gmt";s:19:"2018-01-22 18:14:00";s:21:"post_content_filtered";s:0:"";s:11:"post_parent";s:1:"0";s:4:"guid";s:27:"http://wikiceleb.com/?p=408";s:10:"menu_order";s:1:"0";s:9:"post_type";s:4:"post";s:14:"post_mime_type";s:0:"";s:13:"comment_count";s:1:"0";}i:3;O:8:"stdClass":23:{s:2:"ID";s:3:"421";s:11:"post_author";s:1:"1";s:9:"post_date";s:19:"2017-12-20 21:53:40";s:13:"post_date_gmt";s:19:"2017-12-20 16:08:40";s:12:"post_content";s:7593:"<p style="text-align: justify;">Liverpool FCâ€™s star Philippe Coutinho is expected to leave the club for his dream team FC Barcelona sooner or later. 25 years old Brazilian playmaker who is playing the best football of his career at Liverpool currently was heavily scouted by Spanish giant FC Barcelona in past seasons. Coutinho signed a long-term contract of five years at Liverpool in January 2017 with no release clause which keeps him at the club up to 2022. Despite signing the contract, Coutinho was admitting his dream for playing FC Barcelona. In August, the summer transfer window after season 2016/17 ends, Barcelonaâ€™s bid of 72 million pounds was rejected by Liverpool. Coutinho immediately hands transfer to Liverpool requesting him to leave the club for Barcelona via email. Because of no release clause in his contract and less time for finding his replacement as the transfer window was closing soon, Liverpool holds him by rejecting two more bids from Barcelona with a fee up to 120 million pounds which included necessary add-on. Due to this, he is playing 2017/18 season at Liverpool with 10 goals and 7 assists before Christmas. But it is expected that Barcelona will again come after him by improving bids in this January transfer window or next summer. So Liverpool is scouting a number of players from different leagues for his replacement.</p>
<img class="aligncenter wp-image-423" src="http://wikiceleb.com/wp-content/uploads/2017/12/1-7-300x200.jpg" alt="" width="613" height="408" />
<p style="text-align: justify;">Letâ€™s have a quick review of his playing positions and playing style. Due to his versatility, Coutinho has been playing in the number of positions as per other playersâ€™ availability. He is generally attacking a minded creative player that favors to play no.10 position. Last season he played as winger aside Roberto Firmino and Sadio Mane. But this season, after incoming of Mohamed Salah, Jurgen Klopp is using him in different positions. Due to his creativity, he was moved to central midfield position and switches to no.10 also behind Mane, Firmino and Salah. In Sadio Maneâ€™s absence, he replaces him and plays as a left winger. In Salahâ€™s absence h, replaces him and plays as right winger. Due to his mobility in front line and midfield role, he is easily getting goals and assists this season. So there are very few players that can actually replace him and offer equal attack and creativity. Before moving into players that can replace him, here are two images of Coutinhoâ€™s position used by Jurgen Klopp in recent matches.</p>
<img class="aligncenter wp-image-424" src="http://wikiceleb.com/wp-content/uploads/2017/12/2-7-300x216.jpg" alt="" width="414" height="298" />
<p style="text-align: center;"><span style="text-decoration: underline;">Coutinho operating as central midfielder with availability of wingers Salah and Mane (VS West Brom)</span></p>
<img class="aligncenter wp-image-425" src="http://wikiceleb.com/wp-content/uploads/2017/12/3-6-300x212.jpg" alt="" width="419" height="296" />
<p style="text-align: center;"><span style="text-decoration: underline;">Coutinho operating as left winger on Maneâ€™s absence (VS AFC Bournemouth)</span></p>
So here are top eight players that can replace Coutinho at Liverpool and some of them are scouted also.

<strong>1. Thomas Lemar</strong>

<img class="aligncenter wp-image-426" src="http://wikiceleb.com/wp-content/uploads/2017/12/4-6-300x197.jpg" alt="" width="545" height="358" />

